corpus = (corpus.split(' ')*50).shuffle

# 0 < N < 100000
# 0 < number of ADDs < 40000
# 0 < number of DELs < 10000
# 0 < number of QUERYs < 20000
# 0 < number of WQUERYs < 1000
# 0 < number of boosts < 25
# 0.0 < each score < 100.0
# 0 < data string length < 100 chars

types = %w{user topic question board}

40_000.times do |n|
  puts "ADD #{types.shuffle[0]} e#{n} #{100*rand} #{corpus[(9*n)..(9*n+8)].join(' ')}"
end

to_delete = (0..39999).to_a.shuffle
10_000.times do |n|
  puts "DEL e#{to_delete[n]}"
end

corpus.shuffle!

20_000.times do |n|
  puts "QUERY #{rand(1..20)} #{corpus[(2*n)..(2*n+1)].join(' ')}"
end

1000.times do |n|
  boosts = rand(0..25)
  puts "WQUERY #{rand(1..20)} #{boosts} #{(1..boosts).to_a.map {|n|"#{rand > 0.9 ? types.shuffle[0] : "e#{rand(0..39999)}"}:#{rand*10}"}.join(' ')} #{corpus[(2*n)..(2*n+1)].join(' ')}"
end